import Vue from 'vue'
import App from './App.vue'
import router from './router'
import store from './store'

Vue.config.productionTip = false

export const bus = new Vue();

export class Action {
  constructor(type, data) {
    this.type = type;
    this.data = data;
  }
}

new Vue({
  router,
  store,
  render: h => h(App)
}).$mount('#app')
